mkLexState :: B.ByteString -> LexState
mkLexState input = LexState {
                     curPos   = Position 1 1,
                     curInput = input,
                     curCode  = bol_section,
                     dbgText  = V.fromList . lines' . T.decodeUtf8With T.lenientDecode $ input
